INSERT INTO `aboutuspage` VALUES ('1', 'About Us', '<p><strong>About Us</strong></p>\r\n\r\n<p>The Supercity -&nbsp;Grocery Delivery at Your Doorstep. Currently at Valsad, Silvassa, Daman, Dadra</p>\r\n\r\n<p>Made In India&#39;s, Shopping App - for Online Grocery Shopping!<br />\r\nThe SuperCity Online Grocery Shopping App - Download app for a delightful shopping experience</p>\r\n\r\n<p>Shopping online with The SuperCity is easy since you can shop in the comfort of your home , and have items delivered to your door. When you download the The SuperCity free shopping app on your Android smartphone or tablet You can easily browse our vast selection that includes more than billion items across a range of categories like mobile phones, fashion apparel electronic devices video, accessories, and consumer electronics.<br />\r\n____________</p>\r\n\r\n<p><br />\r\nThe items that you can locate on the The SuperCity shopping app include:</p>\r\n\r\n<p>* Fruits<br />\r\n* Mobiles<br />\r\n* vegetables<br />\r\n* Beverages<br />\r\n* Breakfast Dairy<br />\r\n* Kitchenware<br />\r\n* Household Needs<br />\r\n* Snacks, Insant Foods<br />\r\n* Personal Care<br />\r\n* Baby Care<br />\r\n* Staples<br />\r\n* Grocery- All at one place!</p>\r\n\r\n<p>____________</p>\r\n\r\n<p>Install the The SuperCity app to gain exclusive advantages</p>\r\n\r\n<p>Download your Android shopping app onto the device you are using (phone or tablet) and sign up for yourself. You will then be directed to the Home screen. Here you&#39;ll see links to all categories of products, as well as amazing deals, discounts and special discounts in the Special Zones</p>\r\n\r\n<p>1. You can easily type in the product you&#39;re looking for on the Search tab, and it will be found instantly<br />\r\n2. Find your desired product with filters such as price or style, color and brand to locate the item you want<br />\r\n3. Look up reviews and ratings by other customers , along with the seller&#39;s ratings, price and the details of the item when purchasing the item<br />\r\n4. You can add products to your wishlist by one tap<br />\r\n5. To place an order make sure you select among the simplest payment options: cash on delivery (COD) or debit card or net banking, credit card and UPI enabled PhonePe<br />\r\n6. Keep track of your purchases within the app. You will receive alerts on special offers and price reductions, orders status, exclusive launches , and sales events coming up<br />\r\n____________</p>\r\n\r\n<p>Permissions</p>\r\n\r\n<p>In addition to the basic permissions In addition to the basic permissions The SuperCity shopping app requires access to additional functions on your device to allow it to be able to use the features mentioned above -<br />\r\n* App and Device History: To find critical crashes and to recover the state of the app<br />\r\n* Identity: To use authentic login capabilities, sign in using your Google account<br />\r\n* Location: To showcase most nearly possible stores and delivery boys to the user.<br />\r\n____________</p>\r\n\r\n<p>We are available 24x7 customer service team to resolve any delivery or product related questions. Download the The SuperCity app today and begin shopping!</p>');
