INSERT INTO `product_varient` VALUES ('96', '96', '100', 'ml', '125', '115', '95', '1.2', 'Hair fall is a common problem faced by all, irrespective of gender. Excessive stress, poor diet and ageing are the common causes behind hair fall. Himalaya, the leading herbal skin and hair care brand in India, presents this anti hair fall oil as an effective solution, to those who are worried about their receding hairlines. The Himalaya Herbals anti hair fall hair oil is a result of the laborious research by the beauty experts from Himalaya. It can prevent hair fall by strengthening the roots of your hair and can improve the tensile strength. The anti hair fall hair oil contains extracts of essential herbs such as neem, bael, Indian gooseberry, thistles, fenugreek etc\n \n Each of these herbs has different qualities which can help in the nourishment of your tresses. Neem can work wonders for the scalp as it comes with anti bacterial and anti fungal properties. It can reduce dandruff, heal the scalp and stimulate hair growth. Bael has conditioning properties which can smoothen the rough edges and prevent hair fall. Extracts from Indian gooseberry, an ayurvedic hair tonic, can strengthen the hair follicles and repair the damaged strands of hair. Extracts from thistles and fenugreek also act as anti hair fall tonics. The blended oil is fermented with a right proportion of hair protein which can help in rebuilding the hair and reduces its thinning.\n \n Reduces breakage\n Strengthens hair roots\n Improves tensile strength', '', null, '1', '0');
