INSERT INTO `product_varient` VALUES ('99', '99', '122', 'ml', '190', '185', '165', '1.2', 'An elegant, warm and deep perfume, the New AXE Signature Corporate Body Perfume is for the discerning man who doesn\'t make compromises. Its fragrance is sophisticated yet powerful. Perfect for the man who wants to make an impression in the corporate world. Its fragrance is a powerful combination of warm and woody notes which leave a lasting trail that doesn\'t fade away. It comes in a black can with a masculine design.\n \n Strong, Masculine Fragrance\n A Dynamic and Modern fragrance suited for a man with an active lifestyle\n Fragrances crafted by leading fragrance experts in the World\n Fragrance Family: Warm\n Concentrated & Gas-Free\n 3X More Perfume', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('100', '100', '500', 'gm', '0', '50', '30', '1.2', 'Impact Smart Wash is a revolution that is changing how India is washing her clothes. The Revolutionary Optiblend Technology gives you the complete washing solution. Impact takes care of all types of clothes. The optical brightener brightens whites and adds new life to colours; enzymes remove all types of stains; rough fabrics become softer; cuffs and collars are easily cleaned; and clothes are left germ free and exotically fragrant. Experience the new Impact Smart Wash. The Revolutionary Optiblend Technology in Impact Smart Wash provides a complete washing solution that addresses ten critical areas of fabric care. Super Whiteness & Brightness. Protects Colours. Soft on Fabrics. Long-lasting Fine Perfume. Stain Fighter Enzyme Technology. Effortless Cuffs & Collar Cleaning. Soft on Hands & Sensitive skin. Powerfully efficient in Front and Top load Washing machines, & Bucket Wash. Removes Germs. Effective in Soft & Hard Water.', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('101', '101', '200', 'gm', '100', '96', '76', '1.2', 'India\'s No. 1 Cavity Protection Toothpaste. Colgate\'s Calci-lock Protection helps lock in calcium in teeth and protects them from cavities.\n Benefits :\n \n Complete all around cavity protection.\n Germ protection.\n Cleaner whiter teeth.\n Fresher breath.\n Plaque removal Healthy gums.', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('102', '102', '500', 'ml', '0', '91', '71', '1.2', 'Godrej proclean bathroom cleaner has special formulation with a strong cleansing action and definitive, visible cleaning effects which kills 99.9% germs and removes tough stains, also help to remove grease and grime, soap scum, limescale, mold and mildew.', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('103', '103', '100', 'ml', '180', '178', '158', '1.2', 'Garnier color naturals is crème hair colour which gives 100% grey coverage and beautiful rich color. It is an ammonia free hair color and has a superior colour lock technology which gives you rich long lasting color that lasts upto 8 weeks. Color naturals comes in a range of 8 gorgeous shades especially suited for indian skin tones.\n It is available in an easy to use kit which can be used at your convenience in the comfort of your house! It is enriched with the goodness of 3 oils almond, olive and avocado which nourishes hair and provides shiny, long lasting colour.\n Your hair will love the nourishment and you will love the colour! To use, mix equal parts of the colorant and the developer in a plastic or a glass bowl and apply the mixture to your hair with a brush on dry, unwashed hair. Leave on for 30 minutes and rinse with water. Apply post colour-care conditioner (provided in kit) to the hair and rinse to reveal shiny, rich hair color. Post colour care: we recommend using a colour protect shampoo and conditioner for long lasting colour.', '', null, '1', '0');
