INSERT INTO `product_varient` VALUES ('106', '106', '300', 'gm', '129', '119', '99', '1.2', 'All our 35 and dressings have exceptionally low fat content, at the same time retaining that perfect balance of taste and flavour. Not just that, to ensure unmatched quality, all veeba 35 are manufactured in an iso 22000 certified plant. For the first time in india, such a wide range of tasty and healthy 35 and dressings has been introduced. We have tried to translate our understanding of the changing tastes of the young indian households into finest products possible. You can now make your favourite sandwich, salad or snack in the comfort of your home.', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('107', '107', '100', 'gm', '78', '74', '54', '1.2', 'A trail of freshness and vibrant energy that none can resist. Axe Denim is pure musky indulgence. Men who use the Axe Denim Talc are among those who glide around in style and set the standard in luxury, every time they set out. The masculine and musky scent keeps you refreshed and revived throughout the day. Axe Denim Talc not only gives you a great irresistible fragrance but also gives you protection that you need against sweating.\n \n It controls body odour, when you tend to sweat the most. It absorbs the excessive oil secreted on the skin, gives you deodorant like protection and proves to be a perfect match for harsh summers. Be sharp. Be bold. Be the man every woman desires. We pride ourselves as the creators of irresistible fragrances. Axe fragrances not only smell good but also keep you fresh, clean and confident. Axe range of talcum powders, after shave lotions and deodorants provide longer lasting protection that goes on from work, to party, to after party, to after the after party.\n \n Blend of fruity and musky scent\n Keeps you refreshed and revived\n Safe on skin.\n Gives you a sweat free feeling\n Controls body odour\n Long-lasting fragrance', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('108', '108', '100', 'gm', '50', '48', '28', '1.2', 'Good health includes strong and healthy teeth. Give your teeth one of the best natural care with Dabur Lal Dant Manjan. An Ayurvedic product, Dabur Red Toothpowder gives you strong teeth and healthy gums. The product contains: Ingredients Clove oil: Helps in fighting germs and useful in gingivitis Pudina Satva ; Karpura (Camphor): Helps prevent bad breath and toothache Pippali: Helps prevent toothache Tomar Beej (Zanthoxylum alatum): Helps prevent dental diseases Mantain good oral hygiene to keep all your dental problems away. Also read about the home remedies for toothache to ensure proper dental care. Explore Dabur\'ss other Ayurvedic products & medicines which are formulated using various effective medicinal plants as recommended by ayurveda.', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('109', '109', '400', 'pcs', '240', '238', '218', '1.2', 'Premier Special facial tissue is a finest quality that carries extra-soft and absorbent care. It has more soothing moisturizers than normal tissues.It has got the softest and best tissues serve the purpose of removing dirt from your faceOrigami facial tissues are the smoothest material that is great to use in the sensitive skin and carry alongIt has more soothing moisturizers than normal tissues', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('110', '110', '73', 'gm', '25', '24', '4', '1.2', 'Maggi noodles is one of the largest and most loved food brands Your favorite MAGGI noodles now loaded with goodness of Oat Grains Provides 15% Required Daily Amount (RDA) of Protein A serving of MAGGI Nutri-licious Oats Noodles delivers fibre of 1 bowl of oats Loaded with Soya protein, Crunchy veggies like French Beans, Carrots, Green Peas Quick cook for a time-saving breakfast preparation', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('111', '111', '330', 'gm', '141', '137', '117', '1.2', 'All our 35 and dressings have exceptionally low fat content, at the same time retaining that perfect balance of taste and flavour. Not just that, to ensure unmatched quality, all Veeba 35 are manufactured in an ISO 22000 certified plant.\n Customer convenience is the top priority here at veeba, thus all Veeba 35 and dressings come in specially designed ergonomical bottles, with an easy to apply dispensing system. For the first time in India, such a wide range of tasty and healthy 35 and dressings has been introduced.\n Using our considerable experience in the food processing industry, we have tried to translate our understanding of the changing tastes of the young Indian households into finest products possible. You can now make your favourite sandwich, salad or snack in the comfort of your home.', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('112', '112', '3', 'gm', '160', '157', '137', '1.2', 'Available in three amazing fragrances that keep your bathroom fragrant for up to 30 daysUnique slim gel technologyEasy to use just tear and hangCould be any 3 fragrances', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('113', '113', '80', 'gm', '50', '48', '28', '1.2', 'Himalaya\'s active fresh toothpaste is packed with refreshing herbal ingredients that ensure long-lasting fresh breath. Menthol is a natural refreshing agent, Indian dil prevents mouth odor, while clove and fennel are effective natural astringents that tighten gums. Indian dil is effective in preventing foul oral odor. Miswak inhibits the build-up of dental plaque and therefore is beneficial in the prevention of tooth decay. It reduces gum inflammations and prevents gum bleeding. Its astringent property strengthens gums, too. Cardamom contains chemical constituents like terpenes, which significantly inhibits the growth of oral microbes, leading to healthy gums and fresh breath.Fennel contains terpenes, which give the herb its antimicrobial property, fennel is also a potent astringent that tightens gumsMenthol from mint oils has cooling and analgesic propertiesIt also gives long lasting fresh breath', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('114', '114', '60', 'ml', '125', '115', '95', '1.2', 'Is your skin loosing moisture as the day goes by ? Lakme brings to you a moisturizer which is a blend of wholesome peaches and milk, which nourishes the skin deeply without making it appear oily. This light moisturizer with its soothing fragrance will make you fall in love with it instantly. This lotion easily absorbs into the skin to lock moisture for 12 hours to give you soft, smooth and glowing skin. Choose the right Peach Milk Moisturizer: for light nourishment pick this classic lotion. For intense nourishment - try the Peach Milk Winter lotion.\n About Lakme: Lakme is India\'s No. 1 Color Cosmetics brand offering a wide range of high-end, world-class color cosmetic and skincare Products. Lakme has a vast Product range specially crafted by experts for the Indian skin. The brand has also been redefining fashion in India for over 15 years with Lakme Fashion Week, India\'s premier fashion event. Allergies: In the unlikely event of skin irritation, stop using and consult a doctor immediately. Warning: Avoid contact with eyes. Wash your eyes thoroughly with clean water in case of contact.\n \n Infused with the goodness of peaches and milk\n this light moisturizer has a soothing fragrance\n It easily absorbs into the skin to lock moisture for 12 hours to give you soft, glowing skin for intense nourishment - try the Lakme Peach Milk Winter Lotion For nourishment + sun protection - try the Lakme Peach Milk SPF 24 lotion.\n For the best results, use the Product on an everyday basis', '', null, '1', '0');
