INSERT INTO `product_varient` VALUES ('116', '116', '65', 'gm', '25', '24', '4', '1.2', 'The Sunfeast product portfolio was expanded in early 2005 to include healthy snacking options as well. Sunfeast Pasta Treat, a whole wheat based instant pasta was introduced as a healthy snacking option for children and young adults. Sunfeast pasta is available in four flavours - Masala, Tomato Cheese, Cheese and Sour Cream.\n \n India\'s original instant pasta\n Whole wheat based instant pasta\n Sunfeast pasta is available in four flavours - Masala, Tomato Cheese, Cheese and Sour Cream', '', null, '1', '0');
