INSERT INTO `product_varient` VALUES ('122', '122', '150', 'ml', '190', '170', '150', '1.2', 'Yardley of London has become loved for its beautiful floral fragrances that are timeless classics worn by women of all ages. From light refreshing body sprays to the more indulgent eau de toilettes, we combine only the highest quality ingredients to create long lasting yet delicate fragrances.Yardley London has been a purveyor of quality products since the 17th century when the Yardley family paid King Charles I to grant them a concession to manufacture soap for LondonBringing English Luxury to India with refreshing fragrancesHold upright and spray 15cms from the skin', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('123', '123', '50', 'gm', '0', '20', '0', '1.2', 'Colgate Strong Teeth is Indias most trusted No.1 Anti-Cavity toothpaste for the entire family\n Its calci-lock protection locks calcium in teeth, protecting them from cavities\n The unique formulation ensures complete oral care delivering healthy gums\n And all-round germ protection, plaque removal and a whiter smile\n It is an IDA (Indian Dental Association) accepted toothpaste', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('124', '124', '500', 'ml', '208', '202', '182', '1.2', 'A market leader in its category and one of our oldest brands, Parachute coconut oil today stands for purity and quality. Over the years, the brand has seen a lot of innovations in packaging, sizing and tamper proofing.\n \n Consistent composition and viscosity in every drop of oil\n Long lasting freshness\n 5 Stage Purification process to ensure 100% pure coconut oil every time', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('125', '125', '1', 'pcs', '80', '70', '50', '1.2', 'Colgate 360 Whole Mouth Clean includes revolutionary features to clean the tongue, a prime source of oral germs , as well as teeth, providing you with a whole mouth cleanThis toothbrush provides 151% more germ removal for advanced cleaningThe new 360 Whole Mouth Clean has denser bristles and removes 151% more bad breath causing germs than an ordinary (flat trim) toothbrushColgate 360 Whole Mouth Clean cheans more than just teeth, keeping your cheeks, tounge and gums healthyColgate is No. 1 recommended toothbrush in India', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('126', '126', '50', 'gm', '65', '62', '42', '1.2', 'We often wonder if there is a product that could help us retain shower like fresh radiant throughout the day ! Presenting Pond\'s Sandal Talc. It is infused with real Sandalwood oil that gives you soft and radiant skin and leaves you feeling fresh for longer. It is specifically designed for your skin - with soft and smooth micro talc particles that are easy to apply. Perfect for the summers, it has natural sunscreen that protect you from the harsh damaging sun and provides sun protection. Use generously on your face, neck and underarms to absorb sweat and fight body odour. Powder your face for smoother and brighter skin. Pond\'s Sandal talc comes in a vibrant pack with twist-lock cap for quick and easy dispensing. Use this right after the shower in the morning and before going to the bed in night for the soft and soothing freshness. We offer four mesmerising fragrances Pond\'s Dreamflower Talc with the fragrance of pink Lily, Ponds Magic Talc with the honey acacia perfume, Ponds Sandal Talc with goodness of Sandalwood and Ponds Starlight with international perfume infused with Orchid and Jasmine notes. Ponds Dreamflower Sandal Talc - For beautiful radiant skin everyday !', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('127', '127', '400', 'ml', '189', '180', '160', '1.2', 'The maid at your home usually doesn\'t clean the corners like beneath the bed, behind the curtains and almirahs. This gives Dengue causing mosquito\'s hidden breeding ground. Spraying HIT in the corners kills all hidden mosquitoes. So Kill Dengue with Kaala HIT!Instant actionKills flies and mosquitosKill Malaria with Kaala HIT', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('128', '128', '4', 'gm', '165', '161', '141', '1.2', 'Santoor has grown from a traditional south Indian soap to a modern beauty soap that carries the secret of younger looking skin for wide range of women of different ages and income groups across the country.\n \n The deep acting ingredients of Turmeric and Sandal not just provide a smooth, soft and clear skin but also give a youthful glow to the skin plus it has a fresh energizing and a long lasting fragrance\n Massage gently and rinse thoroughly with water. Keep in a cool and dry place, avoid direct sunlight', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('129', '129', '300', 'gm', '272', '265', '245', '1.2', 'Nestle Cerelac Fortified Baby Cereal with Milk, Multigrain Dal Veg is a complementary food for babies from 12 months onwards. While infants and children have higher requirements of nutrients than adults. 2 serves of Cerelac Multigrain Dal Veg Cereal provides 55% of a baby\'s daily need of iron.An Iron fortified baby cereal for babies from 12 months onwardsA source of 17 important nutrients including vitamins and mineralsProvides 55% of a babys daily need of iron in 2 servesFree from added colors, flavors and preservatives', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('130', '130', '3', 'pcs', '99', '95', '75', '1.2', 'Colgate 360 Charcoal Gold is a premium new variant of 360 is set to create a revolution in the category with its differentiated Gold finish handle & black-gold packaging. Its anti-germ & charcoal infused spiral bristles make this brush more than just a good looker. The special bristles reach inaccessible areas in your mouth to clean and remove stains. The 17 times slimmer tip bristles, reach deeper in between teeth and along gum line. Give your teeth protection against germs and bad breath with 360 Charcoal gold to keep them clean and healthy. Colgate is the No.1 toothbrush brand recommended by dentists.Colgate 360 Charcoal Gold is a premium new variant of 360 is set to create a revolution in the category with its differentiated Gold finish handle black-gold packagingIts anti-germ & charcoal infused spiral bristles make this brush more than just a good lookerThe special bristles reach inaccessible areas in your mouth to clean and remove stains. The 17 times slimmer tip bristles, reach deeper in between teeth and along gum lineGive your teeth protection against germs and bad breath with 360 Charcoal gold to keep them clean and healthyColgate is the No.1 toothbrush brand recommended by dentists', '', null, '1', '0');
