INSERT INTO `product_varient` VALUES ('146', '146', '100', 'gm', '125', '120', '100', '1.2', 'Fragrance has the power to make you feel - fresh, bright, sensual, & happy. New Starlight perfume talc from Ponds - is all of this rolled into one.It possesses fine fragrance - like facets of the French & Haute Parfumerie that can boost your mood uplift your spirit. The whiff of Starlight talc smells so exotic, that it will make anyone go gaga over its international perfume fragrance. It is tailor made for the new-age Indian girl who doesn\'t want to spend an exorbitant amount on a perfume but wants to smell just as great. Ponds Starlight talc is an elegant feminine combination of fresh & fruity notes of passion fruit and blueberry with a rich floral bouquet of creamy white blossoms and delicate orchid. This unforgettable perfume talc is curated to stay on you for your entire workday or a day out with friends or a long dinner date. It gives you long lasting fragrance for upto 6 hours!It is specifically designed for your skin - with soft & smooth micro talc that helps absorb sweat while emitting perfume like fragrance throughout the day. Use the convenient twist lock pack to apply generously after shower or before stepping out of the home.Let people wonder with your unmissable fragrance - what are you wearing and no one\'s gonna believe it\'s a talc and not a perfume!Elegant, feminine, floral and downright sexy & Starlight talc fragrance is there for whatever mood strikes you.\n \n Mesmerising fine fragrance inspired by international perfumes\n Long lasting & for 6 hours\n Smooth & Gentle on skin\n Helps reduces sweat quickly\n Helps you stay fresh & keep skin smooth.\n Specially designed for your skin', '', null, '1', '0');
