INSERT INTO `product_varient` VALUES ('170', '170', '500', 'ml', '99', '94', '74', '1.2', 'Water alone is not effective for germ removal and cleaning vegetables and fruits. It often leaves behind pesticides and is not able to disinfect the vegetables and fruits from food-borne illnesses causing germs. This can affect the health and safety of your family. Introducing ITC nimwash vegetable and fruit wash with 100% natural action and neem and citrus fruit extracts, which effectively washes away pesticides and 99.9% germs from the vegetables and fruits. It has no added artificial dyes, bleach, chlorine or soap and is completely safe to use on your veggies and fruits.\n Nimwash cleans dirt, soil, pesticides and 99.9% germs from the surface of veggies and fruits, so that you can enjoy veggies and fruits, as nature intended them to be. Nimwash cleans vegetables and fruits effectively with the power of natural ingredients. Now wash your vegetables and fruits in convenient and easy to use steps and keep your family healthy and protected from germs. From surfaces of vegetables and fruits. Basis lab study on sample microbes anti-microbial action, basis lab study.\n \n ITC Nimwash vegetable and fruit wash effectively washes away pesticides and 99.9% germs from the fruits and vegetables\n With 100% natural action and neem and citrus fruit extracts, to safely clean the veggies and fruits\n It has no added artificial dyes, colors, chlorine, bleach, soap or preservatives', '', null, '1', '0');
