INSERT INTO `product_varient` VALUES ('173', '173', '200', 'gm', '60', '58', '38', '1.2', 'Papad is often referred to as a thin crispy wafer like dish and is served with khichdi - a traditional Indian dish. These round wafers, also known as pappadums, consist of mouth-watering black pepper and urad flour. They are rolled paper-thin, and dried out in the sun. Quick and easy to prepare appetizer or snack! Serve with chutney, or as an accompaniment to your main dish it is a thin wafer like product, circular in shape, rolled from dough made out of pulse flour, with added spices. It can be consumed raw also and you may roast it in oven also.Ingredients: Urad Dal Flour, Saji Khar, Salt, Black Pepper and Groundnut OilMaterial Feature: VegetarianShelf Life: 4 monthsSpecialty: No artificial colours; No artificial flavour and can be eaten alone or with any kind of mealStorage Instructions: Keep in a cool, dry & hygienic place', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('174', '174', '100', 'ml', '140', '137', '117', '1.2', 'Dehydrated skin can be sore and uncomfortable, not to mention something that could make people feel self-conscious about their appearance. Very dry skin can lead to itchiness, discomfort, even flakiness, and be a real annoyance. Vaseline intensive care advanced repair is clinically proven to help heal very dry skin in just 5 days. It has the ability to seal in water, to give your skin a smoother feel and appearance. When your skin is very dry, it can tighten and develop micro-cracks in the upper layer, leading to irritation and itchiness.\n \n Vaseline advanced repair lotion relieve dryness from the first application with faster miniaturization for visibly reduced dryness within 24 hours. Glycerine and micro-droplets of petroleum jelly work together to lock in moisture and provide intensive miniaturization to help heal dry skin and repair the skin\'s natural barriers. Vaseline advanced repair lotion penetrates very deep within skin surface (stratum corneum) and ensures long lasting healing with regular usage. Revitalize dry, itchy skin by incorporating Vaseline advanced repair in your daily skin regime.\n \n Clinically proven to moisturize and heal very dry skin in 5 days\n It contains glycerine and petroleum jelly, which are great ingredients for naturally dry skin\n Relieves even stubborn dry patches\n Appropriate for sensitive skin\n Long lasting healing with non-greasy feel\n It\'s an fast absorbing formula\n Best for very dry skin', '', null, '1', '0');
