INSERT INTO `product_varient` VALUES ('178', '178', '400', 'ml', '189', '183', '163', '1.2', 'For someone looking to eliminate the menace caused by cockroaches, Red HIT, with its unique formulation and nozzle design, flushes out the cockroaches & kills them. Red HIT has a special Seek \'n\' Kill Applicator which delivers the spray to even the remotest cracks and crevices where cockroaches hide. With Red HIT, No cockroaches for 6 weeks! Take the challenge!Instant action, No cockroaches for 6 weeks!Unique formulation & nozzle designFlushes out cockroaches & kills themSpecial Seek \'n\' Kill ApplicatorSprays to remotest cracks and crevices', '', null, '1', '0');
