INSERT INTO `product_varient` VALUES ('180', '180', '4', 'gm', '98', '95', '75', '1.2', 'It comes with an amazing fragrance that refreshes you. Bath daily with hygienix germ protection soap to keep yourself and your family safe. Hygienix germ protection soap gives you protection from 99.99 percentage germs.', '', null, '1', '0');
