INSERT INTO `product_varient` VALUES ('182', '182', '200', 'ml', '90', '85', '65', '1.2', 'It is an excellent combination of nourishing, cleansing and foaming agent. Amla stimulates hair follicles to promote hair growth, it also improves texture of the hair, shikakai is mild cleanser & conditioner, which removes dirt without striping natural oils. Reetha has natural foaming properties to give your hair an extra bounce It is an excellent combination of nourishing, cleansing and foaming agent Amla stimulates hair follicles to promote hair growth, it also improves texture of the hair shikakai is mild cleanser & conditioner, which removes dirt without striping natural oils', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('183', '183', '50', 'gm', '0', '20', '0', '1.2', 'Colgate Active Salt Toothpaste is packed with the goodness of salt. Its unique formula helps fight hidden germs to give healthy gums and strong teeth. Its refreshing minty taste freshens breath. Colgate is the No. 1 toothpaste brand recommended by dentists Packed with the goodness of salt and minerals Helps keep germs at bay for healthy teeth and gums Refreshing Mint Taste Fights cavities to keep your smile happy and bright Refreshing minty flavour that freshens breath Colgate - No. 1 brand recommended by dentists. + Oral Care Professional Brand Recommendation Study conducted by IPSOS in May 2015', '', null, '1', '0');
