INSERT INTO `product_varient` VALUES ('185', '185', '1', 'pcs', '65', '63', '43', '1.2', 'Gillette Vector Razor with adjust automatically pivoting head fast twin blades shave you twice with each stroke eliminating irritating repeat strokes for a faster shave than with a double edge blade.Automatically adjusting Pivoting HeadComfort Strip with lubricants and aloe for a comfortable shaveTwin Blade System for a Clean Shave', '', null, '1', '0');
INSERT INTO `product_varient` VALUES ('186', '186', '30', 'pcs', '50', '48', '28', '1.2', 'Johnson\'s Buds are made with pure and soft cotton, sterilized and clinically tested. We love babies and we understand a babys hygiene is something that no parent wants to compromise with. The cotton used for Johnson\'s cotton buds is pure and soft in nature and the finished products are sterilized and clinically tested before packaging. The buds are very thin in texture. Hence, you can even use them to clean the delicate areas of your babys body, such as the gaps between fingers and toes and nostrils. These buds for babies can also be used to apply lotions or medicines in sensitive areas. Moms trust Johnson\'s - always mild, gentle and effective.Made with pure and soft cottonCan be used to clean delicate areas of baby\'s bodysterilized and clinically tested before packaging100% clinically proven mild and gentleNever insert a cotton bud into the inner ear or noseEvery Johnson\'s product passes a 5 level safety assurance process', '', null, '1', '0');
