INSERT INTO `store_orders` VALUES ('4311', 'Lakme Peach Milk Moisturizer SPF 24 PA Sunscreen Lotion', 'images/products/GroceryImages/80011701025375_1.jpg', '60', 'ml', '114', '3', '115', '375', 'PIRL483a', '2022-02-28 23:21:31', '1', '3', 'Is your skin loosing moisture as the day goes by ? Lakme brings to you a moisturizer which is a blend of wholesome peaches and milk, which nourishes the skin deeply without making it appear oily. This light moisturizer with its soothing fragrance will make you fall in love with it instantly. This lotion easily absorbs into the skin to lock moisture for 12 hours to give you soft, smooth and glowing skin. Choose the right Peach Milk Moisturizer: for light nourishment pick this classic lotion. For intense nourishment - try the Peach Milk Winter lotion.\n About Lakme: Lakme is India\'s No. 1 Color Cosmetics brand offering a wide range of high-end, world-class color cosmetic and skincare Products. Lakme has a vast Product range specially crafted by experts for the Indian skin. The brand has also been redefining fashion in India for over 15 years with Lakme Fashion Week, India\'s premier fashion event. Allergies: In the unlikely event of skin irritation, stop using and consult a doctor immediately. Warning: Avoid contact with eyes. Wash your eyes thoroughly with clean water in case of contact.\n \n Infused with the goodness of peaches and milk\n this light moisturizer has a soothing fragrance\n It easily absorbs into the skin to lock moisture for 12 hours to give you soft, glowing skin for intense nourishment - try the Lakme Peach Milk Winter Lotion For nourishment + sun protection - try the Lakme Peach Milk SPF 24 lotion.\n For the best results, use the Product on an everyday basis', null, null, null, null, 'Regular', 'Pending', null);
