INSERT INTO `store_orders` VALUES ('4392', 'Vaseline Intensive Care Advanced Repair Body Lotion', 'images/products/GroceryImages/80011701032801.jpg', '100', 'ml', '174', '1', '137', '140', 'BHVT85b8', '2022-03-08 10:48:15', '1', '3', 'Dehydrated skin can be sore and uncomfortable, not to mention something that could make people feel self-conscious about their appearance. Very dry skin can lead to itchiness, discomfort, even flakiness, and be a real annoyance. Vaseline intensive care advanced repair is clinically proven to help heal very dry skin in just 5 days. It has the ability to seal in water, to give your skin a smoother feel and appearance. When your skin is very dry, it can tighten and develop micro-cracks in the upper layer, leading to irritation and itchiness.\n \n Vaseline advanced repair lotion relieve dryness from the first application with faster miniaturization for visibly reduced dryness within 24 hours. Glycerine and micro-droplets of petroleum jelly work together to lock in moisture and provide intensive miniaturization to help heal dry skin and repair the skin\'s natural barriers. Vaseline advanced repair lotion penetrates very deep within skin surface (stratum corneum) and ensures long lasting healing with regular usage. Revitalize dry, itchy skin by incorporating Vaseline advanced repair in your daily skin regime.\n \n Clinically proven to moisturize and heal very dry skin in 5 days\n It contains glycerine and petroleum jelly, which are great ingredients for naturally dry skin\n Relieves even stubborn dry patches\n Appropriate for sensitive skin\n Long lasting healing with non-greasy feel\n It\'s an fast absorbing formula\n Best for very dry skin', null, null, null, null, 'Regular', 'Pending', null);
INSERT INTO `store_orders` VALUES ('4397', 'Vaseline Sun + Pollution Protection SPF 30 Body Lotion', 'images/products/GroceryImages/80011911087710_1.jpg', '400', 'ml', '175', '1', '360', '0', 'LNEX1307', '2022-03-08 10:49:58', '1', '3', 'Everyday exposure to the sun\'s harsh UV rays and city pollution can leave your skin dry, damaged and uneven toned. Vaseline Healthy Bright Sun and Pollution Protection body Lotion with Pollution Protection Formula (PPF) effectively shields your skin and SPF30 PA+++ protects from UVA, UVB and skin pollutants. It contains powerful antioxidants like Provitamin C and E and Vitamin B3 that are known to neutralise skin damage and enhance your skins natural radiance respectively.\n \n Infused with micro-droplets of Vaseline Petroleum Jelly, Vaseline healthy Bright Sun and pollution protection body lotion also helps heal and protects skin from sun damage.\n \n The result is a daily use lotion that not only protects skin from sun and pollution in the city but also deeply moisturizes to help restore its natural glow. It\'s fast absorbing and non-greasy formulation makes it ideal to use throughout the year. Protect your skin\'s natural glow from sun and pollution.\n \n It provides Up to 30X Sun Protection.\n \n Use every day to restore and protect your skin from the harsh sun.\n \n Use twice a day for best results. Reapply after 2-3 hours for effective sun protection\n \n Healing by moisturization of normal dry skin. Action in the epidermal region and within cosmetic domain.', null, null, null, null, 'Regular', 'Pending', null);
