INSERT INTO `store_orders` VALUES ('4736', 'Vaseline Sun + Pollution Protection SPF 30 Body Lotion', 'images/products/GroceryImages/80011911087710_1.jpg', '400', 'ml', '175', '1', '360', '0', 'ZREI803a', '2022-03-12 12:48:45', '1', '3', 'Everyday exposure to the sun\'s harsh UV rays and city pollution can leave your skin dry, damaged and uneven toned. Vaseline Healthy Bright Sun and Pollution Protection body Lotion with Pollution Protection Formula (PPF) effectively shields your skin and SPF30 PA+++ protects from UVA, UVB and skin pollutants. It contains powerful antioxidants like Provitamin C and E and Vitamin B3 that are known to neutralise skin damage and enhance your skins natural radiance respectively.\n \n Infused with micro-droplets of Vaseline Petroleum Jelly, Vaseline healthy Bright Sun and pollution protection body lotion also helps heal and protects skin from sun damage.\n \n The result is a daily use lotion that not only protects skin from sun and pollution in the city but also deeply moisturizes to help restore its natural glow. It\'s fast absorbing and non-greasy formulation makes it ideal to use throughout the year. Protect your skin\'s natural glow from sun and pollution.\n \n It provides Up to 30X Sun Protection.\n \n Use every day to restore and protect your skin from the harsh sun.\n \n Use twice a day for best results. Reapply after 2-3 hours for effective sun protection\n \n Healing by moisturization of normal dry skin. Action in the epidermal region and within cosmetic domain.', null, null, null, null, 'Regular', 'Confirmed', '2022-03-12 22:00:33');
