INSERT INTO `store_orders` VALUES ('4773', 'Hit Cockroach Insect Killer Spray', 'images/products/GroceryImages/60011701027337_2.jpg', '400', 'ml', '178', '1', '183', '189', 'PVHJ703a', '2022-03-13 21:49:42', '1', '3', 'For someone looking to eliminate the menace caused by cockroaches, Red HIT, with its unique formulation and nozzle design, flushes out the cockroaches & kills them. Red HIT has a special Seek \'n\' Kill Applicator which delivers the spray to even the remotest cracks and crevices where cockroaches hide. With Red HIT, No cockroaches for 6 weeks! Take the challenge!Instant action, No cockroaches for 6 weeks!Unique formulation & nozzle designFlushes out cockroaches & kills themSpecial Seek \'n\' Kill ApplicatorSprays to remotest cracks and crevices', null, null, null, null, 'Regular', 'Confirmed', '2022-03-13 21:50:16');
