INSERT INTO `store_orders` VALUES ('4781', 'Himalaya Anti Hair Fall Hair Oil', 'images/products/GroceryImages/60011701010647_2.jpg', '100', 'ml', '96', '1', '115', '125', 'JFIZ485c', '2022-03-14 19:05:32', '1', '12', 'Hair fall is a common problem faced by all, irrespective of gender. Excessive stress, poor diet and ageing are the common causes behind hair fall. Himalaya, the leading herbal skin and hair care brand in India, presents this anti hair fall oil as an effective solution, to those who are worried about their receding hairlines. The Himalaya Herbals anti hair fall hair oil is a result of the laborious research by the beauty experts from Himalaya. It can prevent hair fall by strengthening the roots of your hair and can improve the tensile strength. The anti hair fall hair oil contains extracts of essential herbs such as neem, bael, Indian gooseberry, thistles, fenugreek etc\n \n Each of these herbs has different qualities which can help in the nourishment of your tresses. Neem can work wonders for the scalp as it comes with anti bacterial and anti fungal properties. It can reduce dandruff, heal the scalp and stimulate hair growth. Bael has conditioning properties which can smoothen the rough edges and prevent hair fall. Extracts from Indian gooseberry, an ayurvedic hair tonic, can strengthen the hair follicles and repair the damaged strands of hair. Extracts from thistles and fenugreek also act as anti hair fall tonics. The blended oil is fermented with a right proportion of hair protein which can help in rebuilding the hair and reduces its thinning.\n \n Reduces breakage\n Strengthens hair roots\n Improves tensile strength', null, null, null, null, 'Regular', 'Pending', null);
