INSERT INTO `store_orders` VALUES ('4985', 'Lijjat Moong Papad', 'images/products/GroceryImages/60011701033052_1.jpg', '200', 'gm', '173', '1', '58', '60', 'BBLO7272', '2022-06-18 18:52:56', '1', '3', 'Papad is often referred to as a thin crispy wafer like dish and is served with khichdi - a traditional Indian dish. These round wafers, also known as pappadums, consist of mouth-watering black pepper and urad flour. They are rolled paper-thin, and dried out in the sun. Quick and easy to prepare appetizer or snack! Serve with chutney, or as an accompaniment to your main dish it is a thin wafer like product, circular in shape, rolled from dough made out of pulse flour, with added spices. It can be consumed raw also and you may roast it in oven also.Ingredients: Urad Dal Flour, Saji Khar, Salt, Black Pepper and Groundnut OilMaterial Feature: VegetarianShelf Life: 4 monthsSpecialty: No artificial colours; No artificial flavour and can be eaten alone or with any kind of mealStorage Instructions: Keep in a cool, dry & hygienic place', null, null, null, null, 'Regular', 'Pending', null);
