INSERT INTO `store_orders` VALUES ('4996', 'Savlon Cool Hexa Soap', 'images/products/GroceryImages/70035882544388.jpg', '4', 'gm', '171', '1', '102', '105', 'NIZX44e9', '2022-06-18 19:05:02', '1', '3', 'With summers upon us, Savlon’s new cool hexa soap is here to help you beat the heat! Savlon cool hexa comes with added menthol that gives you and your family an instant cool feeling. But that is not all, it also has Savlon’s hexa pro power which helps you fight the germs that summers bring along. Get 99.9% protection against viruses and odour causing bacteria with Savlon cool hexa.\n \n Gives you an instant cool feeling\n 99.9% protection from viruses and odour causing bacteria\n Advanced germ protection of Savlon now in a cooling soap', null, null, null, null, 'Regular', 'Pending', null);
